description:
शीतलहरका कारण सिरहालगायत तराईको जनजीवन प्रभावित भएको छ ।&amp;nbsp;

चिसो हावाले लहान बजारसहित ग्रामीण क्षेत्रको दैनिक जनजीवन कष्टकर बनेको हो । &amp;nbsp; &amp;nbsp;&amp;nbsp;
&amp;nbsp; &amp;nbsp; &amp;nbsp;
शीतलहरबाट बालबालिका, वृद्धवृद्धा तथा विपन्

अरनिको राजमार्ग अन्तर्गत धुलिखेल&amp;ndash;खावा सडक खण्डको रोकिएको स्तरोन्नति पुनः शुरू भएको छ ।&amp;nbsp;

नयाँ निर्माण कम्पनीसँग गत कात्तिकमा सम्झौता गरिएपछि पुनः स्तरोन्नतिको काम शुरू भएको हो ।

धुलिखेल-खावा सडकका सुपरभाइजर लोकहरि नेपालका अनुसार क

भौतिक पूर्वाधार कार्यालय खोटाङले ११२ आयोजनाका लागि ठेक्का आह्वान गरेको छ ।&amp;nbsp;

कोशी प्रदेश सरकारबाट आर्थिक वर्ष २०८२/८३ का लागि स्वीकृत भएको ६६ करोड बराबरको १२३ आयोजनाको ठेक्का गर्नुपर्ने जनाइएको छ ।&amp;nbsp;

ठेक्का आह्वान भएका आयोजनाका लागि

लगातार एक सातादेखिको बाक्लो हुस्सु र शीतलहरले तराईमा अत्यधिक चिसो बढेको छ ।&amp;nbsp;

लुम्बिनी प्रदेशसहित पश्चिम तराईमा ७ दिनदेखि घाम लागेको छैन । बुधबार बिहान यस क्षेत्रमा शीतलहर चलेर जाडो अत्यधिक बढ्दा जनजीवन नराम्रोसँग प्रभावित भएको छ ।

लुम्बिनी
